sys_variable_value.value:
(function execute(inputs, outputs) {

var user_id = gs.getUserID();

gs.info("USER_ID:" + user_id);

if (user_id == 'system') { user_id = '' }

var gr = new GlideRecord('x_snc_ethsign_account');
gr.addQuery('user', user_id);
gr.addQuery('key', inputs.key.sys_id);
gr.query();
outputs.result = gr.hasNext();

})(inputs, outputs);

